import React from 'react'

const Timer = (props) => {
  const minutes = Math.floor(props.timeleft / 60)
  const seconds = props.timeleft % 60
  return (
    <div style={{ fontWeight: 'bold', width:'100px' }}>
      <span>{minutes}</span>
      <span> :{seconds}</span>
    </div>
  )
}

export default Timer
